import React from 'react'

const nav = () => {
  return (
    <>
      <nav style={{"background":"purple","width":"100","height":"50px"}}>
      <ul style={{"display":"inline","listStyle":"none","color":"white"}}>
      <li style={{"display":"inline-block","paddingLeft":"50px"}}>item</li>
      <li style={{"display":"inline-block"}}>quantity</li>
      <li style={{"display":"inline-block"}}>rate</li>
      <li style={{"display":"inline-block"}}>amount</li>
      </ul>
    </nav>
    </>
  )
}

export default nav;
